import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Button,
} from "reactstrap";

export class menu extends Component {
  state = {
    collapsed: false,
  };
  render() {
    return (
      <div>
        <Navbar color="info" light expand="md">
          <NavbarBrand href="/"> Moncoiffeur</NavbarBrand>
          <NavbarToggler />
          <Collapse isOpen={!collapsed} navbar>
            <Nav className="mr-auto" navbar>
              <NavItem>
                <NavLink href="/">Qui est nous ?</NavLink>
              </NavItem>
            </Nav>
            <Button outline color="primary" className="mr-5">
              creer
            </Button>
            <Button outline color="primary" className="mr-5">
              Connecter
            </Button>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(menu);
